import React from 'react';
import styled from 'styled-components';

const ProjectsContainer = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  height: 100vh;
  background: #f0f0f0;
`;

const Projects = () => {
  return (
    <ProjectsContainer>
      <h1>My Projects</h1>
      <p>This is the Projects Page.</p>
    </ProjectsContainer>
  );
};

export default Projects;
